// DOM functions
function addTextColor(taskDateContainer, isOverDue) {
  if (taskDateContainer.textContent === '') {
    // addDueDateButton(taskDateContainer);
    return;
  }
  if (taskDateContainer.textContent.match(/day/g) && (taskDateContainer.textContent !== 'Today' && taskDateContainer.textContent !== 'Yesterday')) {
    taskDateContainer.classList.add('purpleDayText');
  } else if (taskDateContainer.textContent === 'Today' || isOverDue) {
    taskDateContainer.classList.add('redDayText');
  } else if (taskDateContainer.textContent === 'Tomorrow') {
    taskDateContainer.classList.add('orangeDayText');
  } else {
    taskDateContainer.classList.add('greyDayText');
  }
}
function clearAndRemoveTaskContainer() {
  const addTaskContainer = document.querySelector('.addTaskContainer');
  if (addTaskContainer.style.display === 'none') {
    return;
  }

  const DEFAULT_PRIORITY = 'Priority 2';
  const inputValues = document.querySelectorAll('form > div > input, form > div > textarea');
  const priorityButton = document.querySelector('.priorityButton');
  const dropDownContainer = document.querySelector('.dropDownContainer');
  dropDownContainer.style.display = 'none';
  const selected = dropDownContainer.querySelector('.selected');
  priorityButton.textContent = DEFAULT_PRIORITY;
  priorityButton.className = '';
  priorityButton.classList.add('priorityButton');
  priorityButton.classList.add('priorityTwoColor');
  selected.classList.remove('selected');
  dropDownContainer.querySelector('.priorityTwoColor').classList.add('selected');
  if (addTaskContainer.style.display === 'block') {
    const addButton = document.querySelector('.addButton');
    addTaskContainer.style.display = 'none';
    addButton.style.display = 'flex';
  }
  inputValues.forEach((inputVal) => { const input = inputVal; input.value = ''; });
}
